script: |
  super -f text -I q4449.spq | sort > q4449.out

inputs:
  - name: q4449.spq
    data: |
      SELECT ALL - 10 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 67 * + col1 BETWEEN NULL AND - - col2 + col0 * - + 23;
  - name: tab0

outputs:
  - name: q4449.out
    data: |
      -10
      -10
      -10
